import React, { useState }from 'react';
import './App.css';


function Sidebar(){
    const Sidebar = () => {
        const [isOpen, setIsOpen] = useState(false);

        const togglesidebar = () => {
            setIsOpen(!isOpen);
    };

  return (
    <div className={`sidebar ${isOpen ? 'open' : ''}`}>
     <button onClick={togglesidebar}>Toggle Sidebar</button>
     <ul>
            <li>Profile </li>
            <li>Labs</li>
            <li>Theory</li>
            <li>Examn</li>

        </ul>
    </div>
  );
};
}


export default Sidebar;
